import React from "react"
import { Button } from "@material-ui/core";
const Footer =()=>{
    return(
        <div className="footer">
            <h4>E-commerce Dashboard</h4>
            <Button color="primary">Material UI</Button>
        </div>
    )
}

export default Footer;
